The State files an Amended Information which charges misdemeanor battery, contrary to Section 940.19(1) of the Wisconsin Statutes.  
NO CONTEST plea entered to the amended charge.  Convicted.
The State moves to dismiss and read in the charge in count 2  of the original Information, criminal damage to property and an uncharged incident of theft occurring on 01-07-15, incident no: TR14-6932 involving Madison Cook as the victim.   Motion granted.
Sentence Withheld.  Defendant is placed on probation to DOC for eighteen (18) months.
Conditions of probation:
1) assessment, treatment, counseling as deemed appropriate by the Departments assessment process
2) undergo the batterers treatment assessment and follow through;
3) pay restitution of $120.00 from the uncharged/read-in indicent to Madison Cook at 2012 School Street, Two Rivers, WI;
4) pay court costs;
5) pay supervision fees in an amount to be determined by DOC;
6) obtain GED or HSED;
7) spend thirty (30) days in the county jail, under the Huber Law, commencing on 04-26-15 at 5:00 p.m.
8) additional thirty (30) days in the county jail, under the Huber Law, stayed and to be imposed at the agents discretion and upon order of the court.
$100.00 cash bail is ordered applied to court costs.
Minutes.
